// Step 1: Split strings and structure them
function processListings(listings) {
  return listings.map(listing => {
    // Replace "/" with "," for uniform splitting, then trim results
    return listing.replace(/\//g, ",").split(",").map(part => part.trim());
  });
}

// Step 2: Group listings by address
function groupByAddress(splitListings) {
  return splitListings.reduce((result, [room, level, address]) => {
    if (!result[address]) {
      result[address] = {};
    }
    if (!result[address][level]) {
      result[address][level] = [];
    }
    result[address][level].push(room);
    return result;
  }, {});
}

// Step 3: Format grouped data into output string
function formatOutput(groupedListings) {
  return Object.entries(groupedListings).map(([address, levels]) => {
    const levelDetails = Object.entries(levels)
      .map(([level, rooms]) => ` *${level}\n  ${rooms.sort().join("\n  ")}`)
      .join("\n");
    return `*${address}\n${levelDetails}`;
  }).join("\n\n");
}

// Main execution
const splitListings = processListings(workflowStaticData.listingsForRent);
const groupedListings = groupByAddress(splitListings);
const formattedOutput = formatOutput(groupedListings);

return { formattedOutput }
